(239, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:73:\"Build Yourself as a Creative — Takeaways From Our Webinar With Chris Do\";s:7:\"excerpt\";s:191:\"On our recent webinar with Chris Do, founder of The Futur, we discussed how to recreate yourself as a design professional. Here are the main takeaways from this enlightening discussion.​​\";s:7:\"created\";s:10:\"1593092641\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/webinar-chris-do/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:45:\"How to Create a Lottie Widget Download Button\";s:7:\"excerpt\";s:173:\"This guide to Lottie Animations will show you a creative way to use the Lottie widget as a button and set it to play an animation and download a free eBook upon clicking it.\";s:7:\"created\";s:10:\"1592983739\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/lottie-animations/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:58:\"How to Update WordPress Safely (Tutorial & Best Practices)\";s:7:\"excerpt\";s:233:\"If you want to access the latest features and keep your WordPress site secure and functioning, you need to apply updates as they\'re released. In this post, we\'ll take a deep dive into WordPress updates and how to safely perform them.\";s:7:\"created\";s:10:\"1592836295\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/update-wordpress/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:58:\"9 Websites With Animations That Inspire Us as Web Creators\";s:7:\"excerpt\";s:215:\"Websites with animations are a key ingredient for visual storytelling. Check out these nine examples of websites who’ve added advanced design effects to their sites and have truly mastered the art of animation.​\";s:7:\"created\";s:10:\"1592314235\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/examples-websites-animations/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:63:\"What Is WordPress Multisite? How to Set up a Multisite Network?\";s:7:\"excerpt\";s:178:\"In this post, we\'ll explain how WordPress Multisite works and when you should use it. In addition, we\'ll show you step-by-step how to create your own WordPress Multisite network.\";s:7:\"created\";s:10:\"1592207160\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:127:\"https://elementor.com/blog/what-is-wordpress-multisite/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
