er (Core &gt;=2.7.0)</li>\n<li>Fix: Ampersand character breaks email link in Share Buttons widget</li>\n<li>Fix: Correct custom font attachment <code>mime-type</code> to show uploaded Custom Fonts</li>\n<li>Fix: Mini-Cart not refreshing in Menu Cart widget</li>\n<li>Fix: Cart drawer not working when WC Subscriptions plugin is activated</li>\n<li>Fix:  Querying CPT with custom taxonomies does not show the taxonomies before saving</li>\n<li>Fix: Double rendering on change caused console error in Theme Builder\'s conditions screen</li>\n<li>Fix: Translations and Strings in Share Buttons widget</li>\n<li>Fix: Avoid using offset if the source is Manual selection in Query Control</li>\n<li>Fix: Form being submitted although reCAPTCHA v3 validation failed in Forms widget</li>\n</ul>\n<h4>2.6.5 - 2019-08-26</h4>\n<ul>\n<li>Tweak: Added compatibility for the upcoming release of Elementor v2.7</li>\n<li>Fix: Button style not working when <code>quantity</code> is enabled in Custom Add To Cart widget</li>\n<li>Fix: Updated minified JS file fixed WhatsApp base URL in Share Buttons widget</li>\n</ul>\n<h4>2.6.4 - 2019-08-21</h4>\n<ul>\n<li>Tweak: Added compatibility for the upcoming release of Elementor v2.7</li>\n<li>Fix: Changed WhatsApp base URL in Share Buttons widget for cross-device compatibility</li>\n<li>Fix: Random slides order after several clicks on pagination in Testimonial Carousel widget</li>\n</ul>\n<h4>2.6.3 - 2019-08-18</h4>\n<ul>\n<li>Fix: Core version rollback to <code>&gt;2.6.0</code> causes a fatal error</li>\n<li>Fix: Duplicate images when slideshow skin is selected in Media Carousel lightbox</li>\n<li>Fix: Default bottom margin added to reCAPTCHA V3 badge</li>\n<li>Fix: Input glitch in reCAPTCHA V3 threshold settings</li>\n</ul>\n<h4>2.6.2 - 2019-07-30</h4>\n<ul>\n<li>Tweak: Better accessibility support in Search Form widget</li>\n<li>Fix: UI glitched in Popup publish screen (<a href=\"https://github.com/elementor/elementor/issues/8616\">#8616</a>)</li>\n<l