0\">#2180</a>)</li>\n<li>Tweak: Added Dynamic capabilities for Form Redirect action (<a href=\"https://github.com/elementor/elementor/issues/7552\">#7552</a>)</li>\n<li>Tweak: Added Logged In Message styling options for Login widget (<a href=\"https://github.com/elementor/elementor/issues/7928\">#7928</a>)</li>\n<li>Tweak: Added <code>none</code> breakpoint option to Nav Menu widget (<a href=\"https://github.com/elementor/elementor/issues/7916\">#7916</a>)</li>\n<li>Tweak: Added option to place Post Terms dynamic tag without links (<a href=\"https://github.com/elementor/elementor/issues/8366\">#8366</a>)</li>\n<li>Tweak: Added <code>elementor/query/query_results</code> hook to Query Control to allow full control over results (<a href=\"https://github.com/elementor/elementor/issues/7912\">#7912</a>)</li>\n<li>Tweak: Allow choosing Heading HTML tag in Price Table widget (<a href=\"https://github.com/elementor/elementor/issues/8090\">#8090</a>)</li>\n<li>Tweak: Show popup on dynamic click even when <code>Avoid Multiple Popups</code> option is selected (<a href=\"https://github.com/elementor/elementor/issues/8189\">#8189</a>)</li>\n<li>Tweak: Added condition option to all of archive child pages (<a href=\"https://github.com/elementor/elementor/issues/8256\">#8256</a>)</li>\n<li>Tweak: Added <code>Effects Relative To</code> control to Scrolling Effects</li>\n<li>Tweak: Allow shortcodes in HTML Form field</li>\n<li>Tweak: Removed donReach integration from Share Buttons widget due to service inconsistent stability</li>\n<li>Tweak: Changed MailChimp <code>List</code> label to <code>Audience</code></li>\n<li>Tweak: Improved Entrance and Exit animation behavior in Popup</li>\n<li>Tweak: Added <code>Deprecated Notice</code> control to <code>Archive Products</code> and <code>Woo Products</code> widgets</li>\n<li>Tweak: Added default dynamic title for archives in Theme Builder</li>\n<li>Tweak: Added condition to show <code>Centered Slides</code> control in Media Carousel widget<