pace</code> CSS property causes style glitch in iPad</li>\n<li>Tweak: Added more compatibility for Elementor v2.6</li>\n</ul>\n<h4>2.5.11 - 2019-07-02</h4>\n<ul>\n<li>Fix: Close icon missing from Nav Menu widget (<a href=\"https://github.com/elementor/elementor/issues/8460\">#8460</a>)</li>\n<li>Fix: Elementor Pro v2.5.10 shows PHP notice regarding notice bar (<a href=\"https://github.com/elementor/elementor/issues/8461\">#8461</a>)</li>\n<li>Fix: Fatal error when deleting used Pods fields (<a href=\"https://github.com/elementor/elementor/issues/8396\">#8396</a>)</li>\n<li>Fix: Missing dropdown icon in conditions screen</li>\n</ul>\n<h4>2.5.10 - 2019-05-28</h4>\n<ul>\n<li>Tweak: Added compatibility for the upcoming release of Elementor v2.6</li>\n<li>Tweak: Error caused by empty Rows &amp; Columns values in Products widget (<a href=\"https://github.com/elementor/elementor/issues/8261\">#8261</a>)</li>\n<li>Fix: Do not unset <code>product</code> CPT if it\'s not from WooCommerce (<a href=\"https://github.com/elementor/elementor/issues/8160\">#8160</a>)</li>\n<li>Fix: Column Spacing not working in WooCommerce Archive Products widget (<a href=\"https://github.com/elementor/elementor/issues/8285\">#8285</a>)</li>\n<li>Fix: Title styling not working in Products Categories widget</li>\n<li>Fix: Empty value in Dynamic Pods Gallery dropdown using Safari browser</li>\n<li>Fix: WooCommerce archives included in &quot;All Archives&quot; condition</li>\n</ul>\n<h4>2.5.9 - 2019-05-28</h4>\n<ul>\n<li>Tweak: Removed <code>auto-confirm</code> control from MailPoet to support new version of MailPoet</li>\n<li>Fix: Multiple Custom Fonts not rendered in the editor</li>\n<li>Fix: Products <code>sale</code> query - handle exclude by manual selection.</li>\n<li>Fix: Product Categories grid row &amp; column style</li>\n<li>Fix: Form integration AJAX cache override</li>\n<li>Fix: Removed redundant CSS on Canvas &amp; Header-Footer page templates</li>\n</ul>\n<h4>2.5.8 - 2019-05-06</h4>\n<ul>\n<li>Fix: Popup entrance animation not working in frontend</li>\n<li>Fix: Popup Exit Intent trigger activated multiple times</li>\n</ul>\n<h4>2.5.7 - 2019-05-05</h4>\n<ul>\n<li>Fix: Embedded video keeps playing after a Popup is closed (<a href=\"https://github.com/elementor/elementor/issues/7875\">#7875</a>)</li>\n<li>Fix: Maximum call stack size exceeded error in Safari (<a href=\"https://github.com/elementor/elementor/issues/7824\">#7824</a>)</li>\n<li>Fix: Entrance animations not appearing on Popup reopen (<a href=\"https://github.com/elementor/elementor/issues/7395\">#7395</a>)</li>\n<li>Fix: WC variations select style glitch in several themes (<a href=\"https://github.com/elementor/elementor/issues/8008\">#8008</a>)</li>\n<li>Fix: Theme Builder taxonomy conditions not retrieving proper results in edge cases</li>\n</ul>\n<h4>2.5.6 - 2019-04-29</h4>\n<ul>\n<li>Tweak: Removed <code>Shortcode</code> dynamic from Image, Gallery and Media control</li>\n<li>Fix: Popup not inheriting entrance animation in responsive mode (<a href=\"https://github.com/elementor/elementor/issues/7809\">#7809</a>)</li>\n<li>Fix: Terms autocomplete retrieves wrong results in Query Control</li>\n<li>Fix: Query Control Related by author glitches in edge cases</li>\n<li>Fix: Query Control using terms for Products widget</li>\n<li>Fix: Posts cards style glitch in small screens</li>\n<li>Fix: Display conditions delete icon missing in small screens</li>\n<li>Fix: Avoid rendering Menu Cart widget in WordPress native editor</li>\n</ul>\n<h4>2.5.5 - 2019-04-08</h4>\n<ul>\n<li>Tweak: Allow text selection inside a Popup</li>\n<li>Fix: Added backwards compatibility for <code>tax_query</code> in Query Control (<a href=\"https://github.com/elementor/elementor/issues/7751\">#7751</a>)</li>\n<li>Fix: Missing arguments for <code>widget_title</code> filter (<a href=\"https://github.com/elementor/elementor/issues/7745\">#7745</a>)</li>\n</ul>\n<h4>2.5.4 - 2019-04-03</h4>\n<ul>\n<li>Fix: Move Query from using <code>term_id</code> to <code>term_taxonomy_id</code> (<a href=\"https://github.com/elementor/elementor/issues/7653\">#7653</a>)</li>\n<li>Fix: Offset manipulation hook removal in Query control</li>\n<li>Fix: Missing form field <code>ID</code> in some edge cases (<a href=\"https://github.com/elementor/elementor/issues/7711\">#7711</a>, <a href=\"https://github.com/elementor/elementor/issues/7660\">#7660</a>)</li>\n</ul>\n<h4>2.5.3 - 2019-03-31</h4>\n<ul>\n<li>Tweak: Updated Google Calendar dynamic tag URL (<a href=\"https://github.com/elementor/elementor/issues/7673\">#7673</a>)</li>\n<li>Fix: Missing form field names (<a href=\"https://github.com/elementor/elementor/issues/7651\">#7651</a>)</li>\n<li>Fix: PHP 5.4 backward compatibility in Query Control (<a href=\"https://github.com/elementor/elementor/issues/7633\">#7633</a>)</li>\n<li>Fix: <code>products_deprecated</code> Query Control module compatibility (<a href=\"https://github.com/elementor/elementor/issues/7654\">#7654</a>)</li>\n<li>Fix: Changed query method from <code>term_id</code> to <code>term_taxonomy_id</code> (<a href=\"https://github.com/elementor/elementor/issues/7653\">#7653</a>)</li>\n</ul>\n<h4>2.5.2 - 2019-03-27</h4>\n<ul>\n<li>Fix: Overwrite parent widget type in Global Widget (<a href=\"https://github.com/elementor/elementor/issues/7632\">#7632</a>)</li>\n<li>Fix: Avoid Duplicates option not working in Query Control (<a href=\"https://github.com/elementor/elementor/issues/7635\">#7635</a>)</li>\n<li>Fix: Manual Selection option not working in Query Control (<a href=\"https://github.com/elementor/elementor/issues/7634\">#7634</a>)</li>\n<li>Fix: Incorrect condition caused handlers issues inside popup</li>\n</ul>\n<h4>2.5.1 - 2019-03-26</h4>\n<ul>\n<li>Fix: Query Control invalid call to deprecated action (<a href=\"https://github.com/elementor/elementor/issues/7619\">#7619</a>)</li>\n<li>Tweak: Renamed action hook from <code>elementor_pro/{$widget_name}/query/{$query_id}</code> to <code>elementor/query/{$query_id}</code></li>\n<li>Tweak: Renamed filter hook from <code>elementor_pro/query_control/get_query_args/current_query</code> to <code>elementor/query/get_query_args/current_query</code></li>\n</ul>\n<h4>2.5.0 - 2019-03-26</h4>\n<ul>\n<li>New: Introducing Motion Effects including Scrolling &amp; Mouse effects (<a href=\"https://github.com/elementor/elementor/issues/72\">#72</a>)</li>\n<li>New: Introducing Related Posts for Query Control (<a href=\"https://github.com/elementor/elementor/issues/7306\">#7306</a>, <a href=\"https://github.com/elementor/elementor/issues/7490\">#7490</a>)</li>\n<li>New: Introducing Date query for Query Control</li>\n<li>New: Introducing Sticky Posts support for Query Control (<a href=\"https://github.com/elementor/elementor/issues/2501\">#2501</a>)</li>\n<li>Tweak: Added option to open a Popup by a custom selector (<a href=\"https://github.com/elementor/elementor/issues/6871\">#6871</a>, <a href=\"https://github.com/elementor/elementor/issues/6876\">#6876</a>, <a href=\"https://github.com/elementor/elementor/issues/7258\">#7258</a>)</li>\n<li>Tweak: Option to count when Popup is closed in &quot;Show up to X times&quot; Advanced Rule</li>\n<li>Tweak: Added full border radius control options inside Popup</li>\n<li>Tweak: Changed exit intent icon in Popups</li>\n<li>Tweak: Show only one popup in its own preview</li>\n<li>Tweak: Added responsive support to Popup entrance animation control</li>\n<li>Tweak: Conditions - Singular <code>All Pages</code> string changed to <code>Pages</code></li>\n<li>Tweak: Added form field shortcode support for Drip tags (<a href=\"https://github.com/elementor/elementor/issues/7000\">#7000</a>)</li>\n<li>Tweak: Added dynamic capabilities to Price List widget (<a href=\"https://github.com/elementor/elementor/issues/7258\">#7258</a>)</li>\n<li>Tweak: Added Dynamic capabilities to Custom Attributes (<a href=\"https://github.com/elementor/elementor/issues/6779\">#6779</a>)</li>\n<li>Tweak: Added dynamic capabilities to Flip Box widget (<a href=\"https://github.com/elementor/elementor/issues/6986\">#6986</a>)</li>\n<li>Tweak: Decrease <code>z-index</code> for Nav Menu (<a href=\"https://github.com/elementor/elementor/issues/6869\">#6869</a>)</li>\n<li>Tweak: Changed &quot;Scrolling Effects&quot; section label to &quot;Motion Effects&quot;</li>\n<li>Tweak: Use filter <code>get_meta_viewport</code> for header templates (<a href=\"https://github.com/elementor/elementor/issues/7043\">#7043</a>)</li>\n<li>Tweak: use filterable <code>Util::get_public_post_types()</code> in Theme Builder (<a href=\"https://github.com/elementor/elementor/issues/7172\">#7172</a>)</li>\n<li>Tweak: Added Cloudflare rocket-loader support (<a href=\"https://github.com/elementor/elementor/issues/7443\">#7443</a>)</li>\n<li>Tweak: Added responsive support to WC Products Columns &amp; Rows Gap controls (<a href=\"https://github.com/elementor/elementor/issues/6913\">#6913</a>)</li>\n<li>Tweak: WC Menu cart &quot;View Cart&quot; &amp; &quot;Checkout&quot; buttons styling</li>\n<li>Fix: Custom ID reset to default when dragging repeater</li>\n<li>Fix: Conflict between archive-products widget and WC customizer</li>\n<li>Fix: Add to Cart widget <code>spacing</code> and <code>space-between</code></li>\n<li>Fix: Library view when creating a new Header or Footer</li>\n<li>Fix: Post types labels missing on Add New Template modal</li>\n</ul>\n<h4>2.4.8 - 2019-03-11</h4>\n<ul>\n<li>Fix: Missing query section in Products widget</li>\n<li>Fix: Missing Taxonomy controls in Products widget in edge cases</li>\n</ul>\n<h4>2.4.7 - 2019-03-06</h4>\n<ul>\n<li>Fix: Compatibility Global Widget with Elementor v2.5.0+</li>\n</ul>\n<h4>2.4.6 - 2019-03-04</h4>\n<ul>\n<li>Fix: Pods gallery dynamic when empty (<a href=\"https://github.com/elementor/elementor/issues/7127\">#7127</a>)</li>\n<li>Fix: Duplicate call for conditions screen issue</li>\n<li>Fix: Compatibility with Elementor v2.5.0</li>\n</ul>\n<h4>2.4.5 - 2019-02-18</h4>\n<ul>\n<li>Fix: Image size issue in Testimonial Carousel (<a href=\"https://github.com/elementor/elementor/issues/7058\">#7058</a>)</li>\n<li>Fix: MailChimp groups not saved in a form integration (<a href=\"https://github.com/elementor/elementor/issues/7083\">#7083</a>)</li>\n<li>Fix: Show popup preview only on it\'s own preview</li>\n<li>Fix: Elementor dashboard templates URL corrupted links in edge cases</li>\n</ul>\n<h4>2.4.4 - 2019-02-11</h4>\n<ul>\n<li>Tweak: Added ACF Date Time Picker field support (<a href=\"https://github.com/elementor/elementor/issues/6690\">#6690</a>)</li>\n<li>Tweak: Changed the term of <code>All Posts</code> condition to <code>Posts</code></li>\n<li>Fix: Added <code>&lt;IfModule&gt;</code> to avoid 500 error when <code>mod-headers</code> is missing (<a href=\"https://github.com/elementor/elementor/issues/7034\">#7034</a>)</li>\n<li>Fix: Include post CSS deletion in Global Widget update (<a href=\"https://github.com/elementor/elementor/issues/6856\">#6856</a>)</li>\n<li>Fix: <code>Textarea</code> default value in Forms Widget (<a href=\"https://github.com/elementor/elementor/issues/6934\">#6934</a>)</li>\n<li>Fix: MailPoet latest version caused fatal error (<a href=\"https://github.com/elementor/elementor/issues/6996\">#6996</a>)</li>\n<li>Fix: Fatal Error caused by calling MailPoet deleted method</li>\n<li>Notice: MailPoet <code>Auto Confirm</code> option will now default to &quot;On&quot;</li>\n</ul>\n<h4>2.4.3 - 2019-01-30</h4>\n<ul>\n<li>Fix: Custom Add to Cart widget responsive alignment settings</li>\n<li>Fix: Links in Post Info widget</li>\n<li>Fix: WooCommerce <code>View Cart</code> string translate</li>\n<li>Fix: Wrapper classes for header/footer templates (<a href=\"https://github.com/elementor/elementor/issues/6884\">#6884</a>)</li>\n</ul>\n<h4>2.4.2 - 2019-01-25</h4>\n<ul>\n<li>Tweak: Added pixel units to Close Button position control in Popups</li>\n<li>Fix: Exclude error in WC Products widget</li>\n</ul>\n<h4>2.4.1 - 2019-01-24</h4>\n<ul>\n<li>Tweak: Added CSS classes control to Popup (<a href=\"https://github.com/elementor/elementor/issues/6826\">#6826</a>)</li>\n<li>Tweak: Added responsive image size to Testimonial Carousel widget</li>\n<li>Fix: PHP warning when Toolset Date dynamic is empty (<a href=\"https://github.com/elementor/elementor/issues/6842\">#6842</a>)</li>\n<li>Fix: Support of exclude-ids in WC Products widget</li>\n<li>Fix: Popup close button not clickable</li>\n<li>Fix: Alignment justify issue of Add to Cart widget (<a href=\"https://github.com/elementor/elementor/issues/6749\">#6749</a>)</li>\n<li>Fix: Bad anchors breaks the page JS</li>\n<li>Fix: Popup overlay shown when turned off</li>\n</ul>\n<h4>2.4.0 - 2019-01-21</h4>\n<ul>\n<li>New: Introducing Popup Builder (<a href=\"https://github.com/elementor/elementor/issues/628\">#628</a>)</li>\n<li>New: Added <code>Popup</code> Dynamic Tag</li>\n<li>New: Added <code>Popup</code> forms action after submit</li>\n<li>New: Added User Info dynamic tag (<a href=\"https://github.com/elementor/elementor/issues/6322\">#6322</a>)</li>\n<li>Tweak: Added dynamic capabilities for &quot;Nothing Found&quot; message</li>\n<li>Tweak: Added <code>elementor_pro/theme_builder/archive/escape_nothing_found_message</code> Filter to avoid HTML escaping in &quot;Nothing Found&quot; message (<a href=\"https://github.com/elementor/elementor/issues/6053\">#6053</a>)</li>\n<li>Tweak: Added <code>add_doc_to_location</code> method to Allow insertion of a document to a location</li>\n<li>Fix: <code>z-index</code> issue with CTA widget (<a href=\"https://github.com/elementor/elementor/issues/6486\">#6486</a>)</li>\n<li>Fix: Hide the Post Content widget and show it only in a Single document</li>\n<li>Fix: <code>selector</code> replacement in Custom CSS</li>\n<li>Fix: Apply <code>the_content</code> on the real content only</li>\n<li>Fix: CSS for WC products selector (<a href=\"https://github.com/elementor/elementor/issues/6559\">#6559</a>)</li>\n<li>Fix: Odnoklassniki share URL (<a href=\"https://github.com/elementor/elementor/issues/6638\">#6638</a>)</li>\n<li>Fix: Custom link new tab in Post Info widget (<a href=\"https://github.com/elementor/elementor/issues/5766\">#5766</a>)</li>\n<li>Fix: <code>nofollow</code> link in Flip Box &amp; CTA widgets</li>\n<li>Fix: Post Terms in Post Info widget</li>\n<li>Fix: Added screen reader to some icons &amp; buttons for better accessibility (<a href=\"https://github.com/elementor/elementor/issues/5386\">#5386</a>)</li>\n<li>Fix: Accessibility labels in Reviews widget (<a href=\"https://github.com/elementor/elementor/issues/6630\">#6630</a>)</li>\n<li>Fix: Link to cart page not working when WooCommerce Subscriptions is active</li>\n<li>Fix: MailChimp Selected list not showing on reloading in Form widget</li>\n<li>Fix: Sub-menu arrow position in Nav Menu widget</li>\n<li>Fix: Conflict with WP Security Audit Log plugin (<a href=\"https://github.com/elementor/elementor/issues/6648\">#6648</a>)</li>\n</ul>\n<h4>2.3.1 - 2018-12-19</h4>\n<ul>\n<li>Fix: Template widget search functionality (<a href=\"https://github.com/elementor/elementor/issues/6473\">#6473</a>)</li>\n<li>Fix: Apply <code>the_content</code> filter to post content in theme builder</li>\n</ul>\n<h4>2.3.0 - 2018-12-17</h4>\n<ul>\n<li>New: Introducing Discord Integration for Forms (<a href=\"https://github.com/elementor/elementor/issues/4218\">#4218</a>)</li>\n<li>New: Introducing Slack Integration for Forms</li>\n<li>New: Introducing MailerLite Integration for Forms (<a href=\"https://github.com/elementor/elementor/issues/4462\">#4462</a>)</li>\n<li>New: Activate Elementor Pro plugin by connecting to Elementor account</li>\n<li>Tweak: Added <code>elementor_pro/utils/get_public_post_types</code> filter hook (<a href=\"https://github.com/elementor/elementor/issues/5900\">#5900</a>)</li>\n<li>Tweak: Added <code>loop_start</code> &amp; <code>the_content</code> hooks for Post Content (<a href=\"https://github.com/elementor/elementor/issues/6173\">#6173</a>)</li>\n<li>Tweak: Removed Custom Attributes from Page Settings</li>\n<li>Tweak: Always add the Custom CSS control to the Advanced tab</li>\n<li>Fix: In sub Term condition false positive in edge cases</li>\n<li>Fix: ToolSet Dynamic Image fallback</li>\n<li>Fix: Style glitch with the dropdown color in Nav Menu widget</li>\n<li>Fix: Style glitch in the Conditions screen in Safari browser</li>\n<li>Fix: Ribbon in the CTA widget obscures drop down menu (<a href=\"https://github.com/elementor/elementor/issues/6080\">#6080</a>)</li>\n<li>Fix: The color of label won\'t change color in Widget login</li>\n</ul>\n<h4>2.2.5 - 2018-12-11</h4>\n<ul>\n<li>New: Add Style Tab &amp; Custom CSS for Header &amp; Footer Templates.</li>\n<li>Tweak: Added a better identifier for subpages (<a href=\"https://github.com/elementor/elementor/issues/6362\">#6362</a>)</li>\n<li>Tweak: Removed Custom Attributes from page settings</li>\n<li>Fix: Yahoo event URL date issue (<a href=\"https://github.com/elementor/elementor/issues/6354\">#6354</a>)</li>\n<li>Fix: Allow timezone settings in Google event URL (<a href=\"https://github.com/elementor/elementor/issues/6354\">#6354</a>)</li>\n<li>Fix: Avoid <code>z-index</code> changes by <code>nanocss</code> in build process</li>\n<li>Fix: Added missing WC upsells products CSS</li>\n<li>Fix: Nav Menu dropdown losing color on hover</li>\n<li>Fix: WC Product Add-ons CSS compatibility</li>\n</ul>\n<h4>2.2.4 - 2018-12-04</h4>\n<ul>\n<li>Fix: Global widget not saving changes (<a href=\"https://github.com/elementor/elementor/issues/6340\">#6340</a>)</li>\n<li>Fix: Dynamic tags support in Blockquote widget (<a href=\"https://github.com/elementor/elementor/issues/6334\">#6334</a>)</li>\n<li>Fix: Forms Redirect URL action when using form field values with spaces</li>\n</ul>\n<h4>2.2.3 - 2018-11-29</h4>\n<ul>\n<li>Fix: Missing &quot;Edit Template&quot; in Template widget (<a href=\"https://github.com/elementor/elementor/issues/6271\">#6271</a>)</li>\n<li>Fix: Follow menu anchors with UTF8 characters in Nav Menu</li>\n<li>Fix: Show only supported templates in Template widget</li>\n<li>Fix: Revert conflicting fix for a default order for WC archive</li>\n</ul>\n<h4>2.2.2 - 2018-11-28</h4>\n<ul>\n<li>Fix: Lightbox dynamic tag crashes the editor</li>\n</ul>\n<h4>2.2.1 - 2018-11-28</h4>\n<ul>\n<li>New: Added <code>ACF File</code> Dynamic tag to support text controls.</li>\n<li>Tweak: Added option to hide item count bubble when cart is empty in Menu Cart widget (<a href=\"https://github.com/elementor/elementor/issues/6223\">#6223</a>)</li>\n<li>Tweak: Added Actions group for Lightbox and Contact URL tags</li>\n<li>Tweak: Added filter <code>elementor_pro/dynamic_tags/shortcode/should_escape</code> to avoid escaping in Shortcode dynamic tag</li>\n<li>Tweak: MailPoet3 integration allow Subscriber to to subscribe to multiple lists</li>\n<li>Tweak: Added front-end max file size validation for upload fields</li>\n<li>Tweak: Added <code>by-author</code> per Post-Type condition for theme builder</li>\n<li>Fix: Template widget panel not showing the selected template (<a href=\"https://github.com/elementor/elementor/issues/6271\">#6271</a>)</li>\n<li>Fix: Conflict between ACF with Safari browser on Select option in Dynamic tag</li>\n<li>Fix: Add post classes only for the Single template</li>\n<li>Fix: Set document type as not editable for unsupported document like Global widget</li>\n<li>Fix: Avoid duplicate query for current WC product query</li>\n<li>Fix: Product Archive showing oldest products instead of latest</li>\n<li>Fix: CSS reset in Posts widget using cards skin</li>\n</ul>\n<h4>2.2.0 - 2018-11-19</h4>\n<ul>\n<li>New: Introducing Custom Attributes (<a href=\"https://github.com/elementor/elementor/issues/290\">#290</a>, <a href=\"https://github.com/elementor/elementor/issues/3990\">#3990</a>)</li>\n<li>New: Added evergreen option for Countdown widget (<a href=\"https://github.com/elementor/elementor/issues/4459\">#4459</a>)</li>\n<li>New: Added expire actions option for Countdown widget (<a href=\"https://github.com/elementor/elementor/issues/5242\">#5242</a>)</li>\n<li>New: Introducing Reviews widget (<a href=\"https://github.com/elementor/elementor/issues/3854\">#3854</a>)</li>\n<li>New: Introducing Sitemap widget (<a href=\"https://github.com/elementor/elementor/issues/5594\">#5594</a>)</li>\n<li>New: Added Request Parameter dynamic tag (<a href=\"https://github.com/elementor/elementor/issues/4934\">#4934</a>)</li>\n<li>New: Added Shortcode dynamic tag</li>\n<li>New: Added Image and Video Lightbox dynamic tag</li>\n<li>New: Added Contact URL dynamic tag</li>\n<li>New: Added Featured Image Data dynamic tag</li>\n<li>New: Added default value to each field in the Form widget (<a href=\"https://github.com/elementor/elementor/issues/4268\">#4268</a>)</li>\n<li>New: Added &quot;Any Child Of&quot; condition to template conditions (<a href=\"https://github.com/elementor/elementor/issues/5321\">#5321</a>)</li>\n<li>New: Added &quot;In Child&quot; condition to template conditions (<a href=\"https://github.com/elementor/elementor/issues/5587\">#5587</a>)</li>\n<li>Tweak: Added Form Redirect URL with form values (<a href=\"https://github.com/elementor/elementor/issues/2564\">#2564</a>)</li>\n<li>Tweak: Added default post classes to template wrapper (<a href=\"https://github.com/elementor/elementor/issues/5959\">#5959</a>)</li>\n<li>Tweak: Better labels for terms in Query control (<a href=\"https://github.com/elementor/elementor/issues/6092\">#6092</a>)</li>\n<li>Tweak: Renamed &quot;Child Of&quot; templates condition to &quot;Direct Child Of&quot;</li>\n<li>Tweak: Added <code>elementor/theme/get_location_templates/condition_sub_id</code> filter hook to allow template condition translations</li>\n<li>Tweak: Load the Template Library widget via Ajax for better performance</li>\n<li>Tweak: Added 404 page title for Page Title dynamic tag</li>\n<li>Fix: Menu Cart Toggle has # URL link (<a href=\"https://github.com/elementor/elementor/issues/6141\">#6141</a>)</li>\n<li>Fix: Alignment issue in Nav Menu widget (<a href=\"https://github.com/elementor/elementor/issues/5790\">#5790</a>)</li>\n<li>Fix: Avoid potential security risk in forms</li>\n<li>Fix: Template By Author condition conflicts with 404 page</li>\n<li>Fix: Restored WC Product Content widget in Single Product template</li>\n<li>Fix: Theme Builder Preview URLs for date archives and 404 pages</li>\n<li>Fix: Highlight active menu anchor items only when scrolled into view</li>\n<li>Fix: Carousel Pagination Progress style to support new Swiper version</li>\n</ul>\n<h4>2.1.13 - 2018-11-12</h4>\n<ul>\n<li>Tweak: Added compatibility for new brand Finder in v2.3.0</li>\n<li>Fix: Settings conflict when there are multiple carousels in the page</li>\n</ul>\n<h4>2.1.12 - 2018-11-05</h4>\n<ul>\n<li>Tweak: Added compatibility for the upcoming release of Elementor v2.3</li>\n<li>Tweak: Better performance for Template Library widget</li>\n<li>Fix: Fatal error if a taxonomy used in a dynamic field is removed (<a href=\"https://github.com/elementor/elementor/issues/6029\">#6029</a>)</li>\n<li>Fix: Date Time dynamic tag now respect site language (<a href=\"https://github.com/elementor/elementor/issues/6001\">#6001</a>)</li>\n<li>Fix: Custom CSS printed twice in the front-end</li>\n<li>Fix: ACF Image field PHP warning (<a href=\"https://github.com/elementor/elementor/issues/6051\">#6051</a>)</li>\n</ul>\n<h4>2.1.11 - 2018-10-22</h4>\n<ul>\n<li>New: Added ACF local fields compatibility</li>\n<li>Tweak: Re-brand TypeKit by Adobe Fonts integration</li>\n<li>Fix: Exclude <code>is_embed</code> from Singular condition (<a href=\"https://github.com/elementor/elementor/issues/5915\">#5915</a>)</li>\n<li>Fix: Avoid conflict with Ad Blockers and Share Buttons</li>\n<li>Fix: Current date time dynamic tag now shows local time</li>\n<li>Fix: Avoid conflict with 3rd party plugins that filter the permalink