ct gallery links in RTL</li>\n<li>Fix: Dynamic tags in Call To Action widget</li>\n</ul>\n<h4>2.1.5 - 2018-08-21</h4>\n<ul>\n<li>Tweak: Added compatibility for the upcoming release of Elementor v2.2</li>\n<li>Fix: Posts Widget layout theme compatibility</li>\n<li>Fix: Added compatibility for WooCommerce native style</li>\n</ul>\n<h4>2.1.4 - 2018-08-19</h4>\n<ul>\n<li>Fix: Layout issue compatibility with themes caused by v2.1 (<a href=\"https://github.com/elementor/elementor/issues/5442\">#5442</a>)</li>\n<li>Fix: Dynamic setting in Pricing Table widget (<a href=\"https://github.com/elementor/elementor/issues/5460\">#5460</a>)</li>\n<li>Fix: Hide Target URL control if is not necessary in Blockquote widget</li>\n<li>Fix: Selector specificity for WooCommerce Products widget</li>\n<li>Fix: WooCommerce conflicts in the editor in edge cases</li>\n</ul>\n<h4>2.1.3 - 2018-08-15</h4>\n<ul>\n<li>Fix: Thumbnails in the Posts widget jumping (<a href=\"https://github.com/elementor/elementor/issues/5350\">#5350</a>)</li>\n<li>Fix: Responsive grid in the Share Buttons widget (<a href=\"https://github.com/elementor/elementor/issues/5375\">#5375</a>)</li>\n<li>Fix: Added missing <code>setup_postdata</code> for Product Data Tabs widget</li>\n<li>Fix: Rollback to older version of Flip Box widget to resolve 3D depth issue (<a href=\"https://github.com/elementor/elementor/issues/5399\">#5399</a>)</li>\n<li>Fix: Allowed types in the Upload File field are now case-insensitive (<a href=\"https://github.com/elementor/elementor/issues/5254\">#5254</a>)</li>\n<li>Fix: Carousel behavior when using a single slide</li>\n</ul>\n<h4>2.1.2 - 2018-08-12</h4>\n<ul>\n<li>Fix: Error when ACF Pro is not installed (<a href=\"https://github.com/elementor/elementor/issues/5367\">#5367</a>)</li>\n<li>Fix: Edge cases in Inspector where document is a boolean</li>\n<li>Fix: Edge cases for incorrect file fields in PODS</li>\n</ul>\n<h4>2.1.1 - 2018-08-09</h4>\n<ul>\n<li>Fix: Highlighted text in Animated Headlin