(16616, '_transient_yith_register_771d7560296637e1ad5c3f9694ef8858', 'a:2:{s:6:\"Latest\";s:6:\"1.5.31\";s:9:\"changelog\";s:36969:\"\n		\n\n        <h4>1.5.31 – Released on 14 October 2020</h4>\n        <ul>\n            <li>New: Support for WooCommerce 4.6</li>\n            <li>New: Hide option feature</li>\n            <li>New: Auto Update feature</li>\n            <li>Update: YITH Plugin Framework</li>\n            <li>Fix: First X options free for multiple labels</li>\n            <li>Fix: Admin checkbox problems</li>\n            <li>Fix: WPML categories</li>\n            <li>Fix: Colorpicker error</li>\n            <li>Fix: Wrong filter name</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.30 – Released on 23 September 2020</h4>\n        <ul>\n            <li>Dev: New filter \'yith_wapo_force_enqueue_styles_and_scripts\'</li>\n            <li>Fix: First X options feature</li>\n            <li>Fix: Labels selection</li>\n            <li>Fix: Greek translation</li>\n            <li>Fix: Multi Labels limit selectable elements</li>\n            <li>Fix: Negative percentage discounts</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.29 – Released on 31 Aug 2020</h4>\n        <ul>\n            <li>New: Support for WordPress 5.5</li>\n            <li>New: Support for WooCommerce 4.5</li>\n            <li>New: WooCommerce Multi Currency support</li>\n            <li>Update: YITH Plugin Framework</li>\n            <li>Dev: Load JS only in product page</li>\n            <li>Fix: Gift Cards support</li>\n            <li>Fix: Add-ons options position</li>\n            <li>Fix: Percentage calculation</li>\n            <li>Fix: AND operator in label add-ons</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.28 – Released on 15 Jul 2020</h4>\n        <ul>\n            <li>New: Support for WooCommerce 4.3</li>\n            <li>New: Support for Subscription 2.0</li>\n            <li>Dev: New filter to display price without tax</li>\n            <li>Dev: new filter \'yith_wapo_product_final_price\'</li>\n            <li>Update: YITH Plugin Framework</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.27 – Released on 03 Jun 2020</h4>\n        <ul>\n            <li>New: Support for WooCommerce 4.2</li>\n            <li>Update: Italian language</li>\n            <li>Update: Color & Labels features</li>\n            <li>Update: YITH Plugin Framework</li>\n            <li>Fix: Variation Image Gallery</li>\n            <li>Fix: YITH Quick View add to cart position</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.26 – Released on 15 May 2020</h4>\n        <ul>\n            <li>New: Support for WooCommerce 4.1</li>\n            <li>New: Proteo theme integration</li>\n            <li>New: New replace image function</li>\n            <li>Update: YIT Plugin Framework</li>\n            <li>Fix: Error when deleting an order</li>\n            <li>Fix: Prevent Google index</li>\n            <li>Fix: Dependencies problem</li>\n            <li>Fix: Clickable label price</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.25 – Released on 10 March 2020</h4>\n        <ul>\n            <li>New: Support for WooCommerce 4.0</li>\n            <li>New: WooFood plugin compatibility</li>\n            <li>New: Popups compatibility</li>\n            <li>Update: YIT Plugin Framework</li>\n            <li>Update: Dutch language</li>\n            <li>Dev: Show product options check</li>\n            <li>Dev: New filter to show the add-on type select images</li>\n            <li>Fix: Variations dependencies ignored</li>\n            <li>Fix: Variations dependencies in popup</li>\n            <li>Fix: Radio buttons price calculation</li>\n            <li>Fix: Min value calculation for numeric add-ons</li>\n            <li>Fix: Calendar date format</li>\n            <li>Fix: Collapse feature</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.24 – Released on 9 January 2020</h4>\n        <ul>\n            <li>New: Support for WooCommerce 3.9</li>\n            <li>New: Description and image after selecting an add-on type \"select\"</li>\n            <li>New: Minimum product quantity feature</li>\n            <li>Update: YIT Plugin Framework</li>\n            <li>Update: Spanish language</li>\n            <li>Dev: New filter to limit the variations loading</li>\n            <li>Dev: New filter to disable colorpicker files</li>\n            <li>Dev: New filter to show/hide \"sold individually\" label</li>\n            <li>Fix: Collapsed by default option</li>\n            <li>Fix: WPML direct translation feature</li>\n            <li>Fix: WPML translations of long strings</li>\n            <li>Fix: Enter key in add-ons type number</li>\n            <li>Fix: Checked options on loading</li>\n            <li>Fix: Add-ons price table with totals at 0</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.23 – Released on 5 November 2019</h4>\n        <ul>\n            <li>New: Support for WordPress 5.3</li>\n            <li>New: Support for WooCommerce 3.8</li>\n            <li>Update: YIT Plugin Framework</li>\n            <li>Dev: Increased add-ons options db size</li>\n            <li>Fix: Variations dependencies loading time</li>\n            <li>Fix: Elementor compatibility</li>\n            <li>Fix: WPML check if actived</li>\n            <li>Fix: WPML strings strip</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n\n        <h4>1.5.22 – Released on 9 October 2019</h4>\n        <ul>\n            <li>New: WPML options direct translation</li>\n            <li>New: Price suffix to the total table</li>\n            <li>New: Grouped products support</li>\n            <li>Update: YIT Plugin Framework</li>\n            <li>Dev: New filter \'yith_wapo_get_translated_products\'</li>\n            <li>Dev: New hook \'yith_wapo_start_addon_list\'</li>\n            <li>Dev: New filter \'yith_wapo_get_thumbnail_for_addons_image\'</li>\n            <li>Fix: Attributes selection in loop pages</li>\n            <li>Fix: Issue when showing hidden field for Bundle integration</li>\n            <li>Fix: Uppercase file extensions problem</li>\n            <li>Fix: Duplicate groups problem</li>\n            <li>Fix: Add-on description links</li>\n            <li>Fix: Sold individually add-ons with Role Based plugin</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.21 - Released on Aug 12, 2019</h4>\n        <ul>                \n            <li>New: WooCommerce 3.7 support</li>\n            <li>New: 7up themes compatibility</li>\n            <li>Update: YIT Plugin Framework</li>\n            <li>Fix: Keypress problem</li>\n            <li>Fix: AND operator</li>\n            <li>Fix: All add-ons collapses by default</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.20 - Released on Jun 27, 2019</h4>\n        <ul>                \n            <li>New: WC Embed Product support</li>\n            <li>New: Replace image method for Divi theme</li>\n            <li>New: Option to disable the \"labels\" features</li>\n            <li>New: Option to enable again the \"add to cart\" feature in loop</li>\n            <li>New: Alternate collapse feature</li>\n            <li>Update: YIT Plugin Framework 3.3.5</li>\n            <li>Fix: WooCommerce attribute name conflict</li>\n            <li>Fix: Cart numeric price error</li>\n            <li>Fix: File validation with Request a Quote plugin</li>\n            <li>Fix: Options position</li>\n            <li>Fix: First X free options feature</li>\n            <li>Fix: Replacing image size</li>\n            <li>Fix: jQuery UI filter</li>\n            <li>Fix: QuickView Pro support</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.19 - Released on May 28, 2019</h4>\n        <ul>                \n            <li>New: WordPress 5.2 support</li>\n            <li>Update: Italian language</li>\n            <li>Update: YIT Plugin Framework 3.2.1</li>\n            <li>Fix: Calculate quantity by values amount</li>\n            <li>Fix: Request a Quote error message</li>\n            <li>Fix: Undefined offset notice</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.18 - Released on Apr 11, 2019</h4>\n        <ul>                \n            <li>New: WordPress 5.1 support</li>\n            <li>New: WooCommerce 3.6 support</li>\n            <li>New: WooCommerce bundle products support</li>\n            <li>New: Filter to change the add-ons title HTML tag</li>\n            <li>New: Scroll product page when required options are not selected</li>\n            <li>New: \"Replace Image\" method sent by the customer Paul McWalters</li>\n            <li>Update: YIT Plugin Framework 3.1.28</li>\n            <li>Dev: Tax included string</li>\n            <li>Fix: Collapsed feature in Quick View</li>\n            <li>Fix: Add-ons negative percentage values and variations</li>\n            <li>Fix: Missing description-field.php template notice</li>\n            <li>Fix: Image replacement</li>\n            <li>Fix: Options images size</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.17 - Released on Feb 20, 2019</h4>\n        <ul>                \n            <li>New: TheGem theme support</li>\n            <li>Tweak: Add-ons panel loading speed optimization</li>\n            <li>Update: YITH Plugin Framework 3.1.21</li>\n            <li>Fix: Missing variation-gallery.php template</li>\n            <li>Fix: Grouped products support</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.16 - Released on Jan 28, 2019</h4>\n        <ul>                \n            <li>New: WooCommerce Currency Switcher support</li>\n            <li>Update: Language file</li>\n            <li>Update: YIT Plugin Framework 3.1.15</li>\n            <li>Dev: Allow external plugins to save custom options array</li>\n            <li>Fix: Composite Product component variation price reset</li>\n            <li>Fix: Required options</li>\n            <li>Fix: Admin menu</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.15 - Released on Dic 05, 2018</h4>\n        <ul>                \n            <li>New: WordPress 5.0 support</li>\n            <li>New: Plugin options to enable compatibiliy</li>\n            <li>Dev: Improved Woo Layout Injector support</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.14 - Released on Dic 05, 2018</h4>\n        <ul>                \n            <li>New: Divi theme support</li>\n            <li>New: Woo Layout Injector plugin support</li>\n            <li>Update: All .po files</li>\n            <li>Update: YIT Plugin Framework 3.1.5</li>\n            <li>Dev: Improved WPML support with required variations</li>\n            <li>Fix: Number add-ons \"min\" value problem</li>\n            <li>Fix: Variations and attributes disappear after saving</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.13 - Released on Nov 07, 2018</h4>\n        <ul>                \n            <li>New: Alternative \"Replace Image\" method for non standard themes support</li>\n            <li>Update: YIT Plugin Framework 3.0.35</li>\n            <li>Update: Dutch language</li>\n            <li>Fix: Elementor support</li>\n            <li>Fix: Deprecated .size() method of jQuery 1.8</li>\n            <li>Fix: Quick View</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n        <h4>1.5.12 - Released on Oct 23, 2018</h4>\n        <ul>                \n            <li>Update: YIT Plugin Framework 3.0.27</li>\n            <li>Fix: Required options</li>\n            <li>Fix: Minor bugs</li>\n        </ul>\n        \n  