mium(with versions grather than 1.1.6)</li>\n				<li>Fix: Total box was duplicated with Avada theme and variable product</li>\n				<li>Fix: Prevent variations limit for the \"Variation Requirements\" field</li>\n            </ul>\n		<h4>1.2.0.7 - Released on Nov 23, 2016</h4>\n            <ul>                \n                <li>Fix: The Add-ons order can\' t be saved in the backend</li>\n                <li>Fix: The Add-ons price get 0 when decimal separator is not the point</li>\n            </ul>\n        <h4>1.2.0.6 - Released on Nov 22, 2016</h4>\n            <ul>                \n                <li>New: Option \"Replace the product image\" that allows the customer to replace the product featured image when the add-on is selected</li>\n				<li>Fix: Min and Max option values doesn\' t appear in the administration panel after saving</li>\n				<li>Fix: Required field not works for checkboxes when the option \"max item selected\" is set</li>\n            </ul>\n		<h4>1.2.0.5 - Released on Nov 10, 2016</h4>\n            <ul>                \n                <li>Fix: Add option doesn\' t work with some configurations.</li>\n            </ul>\n        <h4>1.2.0.4 - Released on Nov 09, 2016</h4>\n            <ul>                \n				<li>New: Administration restyling.</li>\n				<li>Fix: Add to cart button was disabled with Flatsome theme.</li>\n            </ul>\n		<h4>1.2.0.3 - Released on Oct 31, 2016</h4>\n            <ul>                \n				<li>Fix: Total preview was not updated right after variation was changed.</li>\n				<li>Fix: First element with the add-ons \"select\" was not stored in the cart.</li>\n            </ul>\n		<h4>1.2.0.2 - Released on Oct 26, 2016</h4>\n            <ul>                \n				<li>New: Hide price feature with YITH WooCommerce Catalog Mode Premium and YITH WooCommerce Requeste a Quote Premium</li>\n				<li>Fix: Labels and descriptions of the Add-Ons were not translated on the customer email even if translation was complete on WPML String Translations</li>\n            </ul>\n		<h4>1.2.0.1 - Released on Oct 19, 2016</h4>\n            <ul>\n                <li>Fix: Add-on with dependence doesn\' t appear even if the correct variation was selected</li>\n				<li>Fix: Prevent notice in the back-end when a new add-on was inserted</li>\n            </ul>\n		<h4>1.2.0 - Released on Oct 18, 2016</h4>\n            <ul>\n                <li>New: Possibility to hide add-ons until a specified option or variartion is selected</li>\n                <li>New: Integration with YITH WooCommerce Role Based Price</li>\n                <li>New: Flatsome quick view compatibility</li>\n                <li>New: Exclude products field on group</li>\n                <li>Fix: Click doesn\' t fire on radio button label</li>\n                <li>Fix: Error was printed when a customer receives YITH WooCommerce Request a quote email</li>\n                <li>Fix: Add-ons name and value was not translated by WPML on the Cart</li>\n                <li>New: Change product image on hover (only for one attirbute) - Variations</li>\n                <li>New: Option to show custom attributes style also on \"Additional Information\" Tab - Variations</li>\n                <li>New: Compatibility with WooCommerce Products Filter - Variations</li>\n                <li>New: Compatibility with YITH Composite Products For WooCommerce - Variations</li>\n                <li>New: Compatibility with WooCommerce Quick View by WooThemes - Variations</li>\n                <li>Fix: Reset attribute type on plugin deactivation - Variations</li>\n                <li>Fix: Description and default variations on archive pages - Variations</li>\n                <li>Updated: Language files - Variations</li>\n                <li>Updated: Core plugin - Variations</li>\n            </ul>\n        <h4>1.1.4 - Released on July 08, 2016</h4>\n            <ul>\n                <li>Updated:  Language files</li>\n				<li>Fix: Wrong total price preview when variation is changed</li>\n				<li>Fix: Default variation on single product pages for products with only one attribute</li>\n				<li>Fix: Issue when there were two labels in two different group</li>\n            </ul>\n		<h4>1.1.3 - Released on Jun 10, 2016</h4>\n            <ul>\n                <li>New:  WooCommerce 2.6 support</li>\n                <li>New:  Option \"Max Items Selected\" for checkboxes add ons</li>\n            </ul>\n        <h4>1.1.2 - Released on May 31, 2016</h4>\n            <ul>\n                <li>Updated: Language files</li>\n				<li>Fix: jQuery event not triggered with \"The Edge / Internet Explorer\" browser</li>\n				<li>Fix: Product Add-On Group is not saved because of mysql error</li>\n            </ul>\n		<h4>1.1.1 - Released on May 26, 2016</h4>\n            <ul>\n                <li>Fix: error on add to cart when add-on is not \"sold individually\"</li>\n            </ul>\n		<h4>1.1.0 - Released on May 26, 2016</h4>\n            <ul>\n                <li>New: Support to WordPress 4.5.2.</li>\n				<li>New: Support to WooCommerce 2.6 Beta2.</li>\n				<li> = Add-Ons =</li>\n				<li>New: \"Sold individually\" add-ons option that allow user to sell an add-on lonely(* the price will not increases by cart quantity).</li>\n				<li>New: \"Upoad File size\" option on settings that allow the administrator to set max uploaded file size.</li>\n				<li>New: \"Vendor\" option on group that allow administrator to change the vendor previously store.</li>\n				<li>New: Option \"Show product price on \'cart page\'\" that allow you to show the product base price on the cart item.</li>\n				<li>Fixed: minor bugs.</li>\n				<li>= Variations =</li>\n				<li>New: Compatibility with YITH WooCommerce Added to Cart Popup.</li>\n				<li>New: Set dual color such as blue-white (half box blue and half box white).</li>\n				<li>New: Show a preview of the attribute image in the tooltip (available only for image attributes).</li>\n				<li>Fix: Variations now work with Owl Carousel 2 when infinite loop option is set.</li>\n				<li>*Fix: Clicking on selected attribute before selecting another one is no longer necessary.</li>\n				<li>Updated: Language files.</li>\n				<li>Updated: Core plugin.</li>\n            </ul>\n		<h4>1.0.9 - Released on May 05, 2016</h4>\n            <ul>\n                <li>Fix: prevent localize domain issue</li>\n            </ul>\n        <h4>1.0.8 - Released on May 04, 2016</h4>\n            <ul>\n                <li>New: support to YITH WooCommerce Request a Quote - 1.4.7 version</li>\n            </ul>\n        <h4>1.0.7 - Released on Apr 28, 2016</h4>\n            <ul>\n                <li>Updated: Text Domain</li>\n                <li>Fix: minor bugs</li>\n            </ul>\n		<h4>1.0.6 - Released on Apr 14, 2016</h4>\n            <ul>\n                <li>Fix: Prevent notice on products loop</li>\n            </ul>\n		<h4>1.0.5 - Released on Apr 13, 2016</h4>\n            <ul>\n                <li>New: WordPress 4.5 support</li>\n            </ul>\n		<h4>1.0.4 - Released on Apr 12, 2016</h4>\n            <ul>\n                <li>Fix: Request a quote button not working in the products loop</li>\n                <li>Fix: Removed unuseless query execution</li>\n            </ul>\n		<h4>1.0.3 - Released on Apr 09, 2016</h4>\n            <ul>\n                <li>New: WPML support</li>\n				<li>Fix: Options total price was not correct when user change quantity on single product page</li>\n            </ul>\n		<h4>1.0.2 - Released on Apr 04, 2016</h4>\n            <ul>\n                <li>Fix: Options are not saved when a quote was inserted inside a label</li>\n            </ul>\n		<h4>1.0.1 - Released on Apr 01, 2016</h4>\n            <ul>\n                <li>Fix: Price total doesn\' t change after option is selected on quick view</li>\n            </ul>\n		<h4>1.0.0 - Released on Mar 31, 2016</h4>\n            <ul>\n                <li>Initial Release</li>\n            </ul>\n		\n    \";}', 'no'),
