(231, 1, '2020-06-15 07:52:30', '2020-06-15 07:52:30', '<img width=\"1024\" height=\"567\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-1024x567.png\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-1024x567.png 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-600x332.png 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-300x166.png 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-768x425.png 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-1536x851.png 1536w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-2048x1134.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n			<h3>Metrocentro San Salvador</h3>		\n			<a href=\"https://avplustuoptica.com/conocemos/\" role=\"button\">\n						DIRECCION\n					</a>\n										<img width=\"1920\" height=\"1080\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001.jpeg 1920w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-600x338.jpeg 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-300x169.jpeg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-1024x576.jpeg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-768x432.jpeg 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-1536x864.jpeg 1536w\" sizes=\"(max-width: 1920px) 100vw, 1920px\" />											\n		<p>Estamos ubicados en el lugar mas accesible para ofrecer a nuestro pacientes en el área metropolitana.</p><p>Contamos con las salas de optica mas exclusivas y diseños minimalistas, para que te sientas confortable.</p><p>Aros de la mejores calidades, la mas amplia variedades de modelos y colores que podrás encontrar en una optica.</p><p>Los lentes todos son garantizados por una marca internacional como lo es Essilor Internacional.</p>		\n										<img width=\"1358\" height=\"781\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110.jpg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110.jpg 1358w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-600x345.jpg 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-300x173.jpg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-1024x589.jpg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-768x442.jpg 768w\" sizes=\"(max-width: 1358px) 100vw, 1358px\" />											\n										<img width=\"1024\" height=\"474\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1024x474.png\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1024x474.png 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-600x278.png 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-300x139.png 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-768x355.png 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1536x711.png 1536w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-2048x948.png 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n			<h3>Ciudad Arce</h3>		\n			<a href=\"https://avplustuoptica.com/conocemos/\" role=\"button\">\n						Dirección \n					</a>\n										<img width=\"1029\" height=\"1079\" src=\"https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001.jpeg 1029w, https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-600x629.jpeg 600w, https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-286x300.jpeg 286w, https://avplustuopti