(296, 1, '2020-06-18 17:29:48', '2020-06-18 17:29:48', '<img width=\"300\" height=\"166\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-300x166.png\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-300x166.png 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-600x332.png 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-1024x567.png 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-768x425.png 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-1536x851.png 1536w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-negro-2048x1134.png 2048w\" sizes=\"(max-width: 300px) 100vw, 300px\">\n<h3>Metrocentro San Salvador</h3>\n<a href=\"https://avplustuoptica.com/conocemos/\" role=\"button\">\nDIRECCION\n</a>\n<img width=\"1920\" height=\"1080\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001.jpeg 1920w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-600x338.jpeg 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-300x169.jpeg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-1024x576.jpeg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-768x432.jpeg 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/METRO.001-1536x864.jpeg 1536w\" sizes=\"(max-width: 1920px) 100vw, 1920px\">\n\nEstamos ubicados en el lugar mas accesible para ofrecer a nuestro pacientes en el área metropolitana.\n\nContamos con las salas de optica mas exclusivas y diseños minimalistas, para que te sientas confortable.\n\nAros de la mejores calidades, la mas amplia variedades de modelos y colores que podrás encontrar en una optica.\n\nLos lentes todos son garantizados por una marca internacional como lo es Essilor Internacional.\n\n<img width=\"1358\" height=\"781\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110.jpg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110.jpg 1358w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-600x345.jpg 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-300x173.jpg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-1024x589.jpg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/IMG_6110-768x442.jpg 768w\" sizes=\"(max-width: 1358px) 100vw, 1358px\">\n<img width=\"300\" height=\"139\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-300x139.png\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-300x139.png 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-600x278.png 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1024x474.png 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-768x355.png 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1536x711.png 1536w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-2048x948.png 2048w\" sizes=\"(max-width: 300px) 100vw, 300px\">\n<h3>Ciudad Arce</h3>\n<a href=\"https://avplustuoptica.com/conocemos/\" role=\"button\">\nDirección\n</a>\n<img width=\"286\" height=\"300\" src=\"https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-286x300.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-286x300.jpeg 286w, https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-600x629.jpeg 600w, https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-977x1024.jpeg 977w, https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001-768x805.jpeg 768w, https://avplustuoptica.com/wp-content/uploads/yith_advanced_product_options/optica-arce.001.jpeg 1029w\" sizes=\"(max-width: 286px) 100vw, 286px\">\n\nUbicación estratégica para ofrecer el servicio mas rápido y personalizado para todas las empresas que tenemos convenio en dicha zona de los alrededores.\n\n<img width=\"300\" height=\"139\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-300x139.png\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-300x139.png 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-600x278.png 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1024x474.png 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-768x355.png 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-1536x711.png 1536w, https://avplustuoptica.com/wp-content/uploads/2020/06/logo-blanco-2048x948.png 2048w\" sizes=\"(max-width: 300px) 100vw, 300px\">\n<h3>Santa Ana\nPlaza Trebol</h3>\n<a href=\"https://avplustuoptica.com/conocemos/\" role=\"button\">\nDirección\n</a>\n<img width=\"1444\" height=\"1079\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/sa.001.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/sa.001.jpeg 1444w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa.001-600x448.jpeg 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa.001-300x224.jpeg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa.001-1024x765.jpeg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa.001-768x574.jpeg 768w\" sizes=\"(max-width: 1444px) 100vw, 1444px\">\n\nEstamos ubicados en la entrada de Santa Ana, en Plaza El Trebol, el acceso mas fácil, con amplio parqueo garantizado para tu seguridad.\n\nExamenes totalmente digitalizados, desde tu graduación hasta tus medidas de los lentes para ofrecerte la mejor corrección optica, que puedes encontrar en Santa Ana.\n\n<img width=\"1433\" height=\"1054\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/sa2.001.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/sa2.001.jpeg 1433w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa2.001-600x441.jpeg 600w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa2.001-300x221.jpeg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa2.001-1024x753.jpeg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/sa2.001-768x565.jpeg 768w\" sizes=\"(max-width: 1433px) 100vw, 1433px\">', 'Sucursales', '', 'inherit', 'closed', 'closed', '', '157-revision-v1', '', '', '2020-06-18 17:29:48', '2020-06-18 17:29:48', '', 157, 'https://avplustuoptica.com/2020/06/18/157-revision-v1/', 0, 'revision', '', 0),
