(432, 1, '2020-06-22 05:12:32', '2020-06-22 05:12:32', '<img width=\"1920\" height=\"1080\" src=\"https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001.jpeg\" alt=\"\" srcset=\"https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001.jpeg 1920w, https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001-medium.jpg 300w, https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001-768x432.jpg 768w, https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001-large.jpg 1024w, https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001-1536x864.jpg 1536w, https://avplustuoptica.com/wp-content/uploads/2020/06/conocenos-p1.001-600x338.jpg 600w\" sizes=\"(max-width: 1920px) 100vw, 1920px\" />											\n			<h3>QUIENES SOMOS</h3>		\n		<p>Optica AV Plus, es una empresa que nació hace 8 años con finalidad principal de brindar las mejores soluciones visuales a todos los pacientes, con la tecnología mas actualizada, profesionales capacitados, y los mejores modelos de aros.</p><p>Nos enfocamos en brindar la mejor atención al cliente, para solucionar tus problemas visuales.</p><p>Contamos con marcas exclusivas que ofrecen una gran calidad y diseño, materiales de acetato puro hechos a mano cada aro. Y así mismo con las marcas mas prestigiosas: Rayban, Converse, Carolina Herrera, Guess, Gucci, Mont Black, Nike, Calvin Klien, Oakley, entre otras.</p><p>El equipo esta actualizado para poder realizar y diagnosticar tu graduación lo mas precisa posible. Automatizamos todo tu examen, desde la toma de tu graduación hasta de las medidas del lente.</p><p>El personal esta altamente calificado, con licenciados en Optometria para determinar la mejor corrección óptica que necesitas, y asesores visuales capacitados para ofrecerte la mejor montura y solución visual.</p>		\n			<h2>Contactanos</h2>		\n		<p>Envíanos un Mensaje</p>		\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=Optica%20AV%20Plus%20Metrocentro%20San%20Salvador%20Local%20%237%20Etapa%204&amp;t=m&amp;z=15&amp;output=embed&amp;iwloc=near\" aria-label=\"Optica AV Plus Metrocentro San Salvador Local #7 Etapa 4\"></iframe>		\n				<h3>\n					Optica AV Plus Metrocentro San Salvador Local #7 Etapa 4.\n				</h3>\n				<h3>\n					(+503) 2260-1653, (+503) 7469-2542\n				</h3>', 'Conocemos', '', 'inherit', 'closed', 'closed', '', '108-revision-v1', '', '', '2020-06-22 05:12:32', '2020-06-22 05:12:32', '', 108, 'https://avplustuoptica.com/2020/06/22/108-revision-v1/', 0, 'revision', '', 0),
