INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Trucos, actualizaciones de productos e inspiración', 'Estamos aquí para ti - consigue trucos, actualizaciones de productos e inspiración en tu buzón', 'mail', '{}', 'unactioned', 'woocommerce-admin', '2020-06-15 05:04:00', NULL, 0),
(2, 'wc-admin-marketing-intro', 'info', 'en_US', 'Conecta con tu audiencia', 'Aumenta tu base de clientes e incrementa tus ventas con las herramientas de marketing creadas para WooCommerce.', 'speaker', '{}', 'unactioned', 'woocommerce-admin', '2020-06-15 05:04:00', NULL, 0),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Conectar con WooCommerce.com', 'Conéctate para recibir avisos y actualizaciones importantes de productos.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-06-15 05:04:00', NULL, 0),
(4, 'wc-admin-mobile-app', 'info', 'en_US', 'Instala la aplicación móvil WooCommerce', 'Instala la aplicación móvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver métricas clave – allí donde estés.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2020-06-17 05:10:47', NULL, 0),
(5, 'wc-admin-orders-milestone', 'info', 'en_US', 'Primer pedido', '¡Enhorabuena por conseguir tu primer pedido de un cliente! Aprende cómo gestionar tus pedidos.', 'trophy', '{}', 'unactioned', 'woocommerce-admin', '2020-06-19 03:04:07', NULL, 0),
(6, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Ayuda a WooCommerce a mejorar con el seguimiento de uso', 'Recopilar datos de uso nos permite mejorar WooCommerce. Se tendrá en cuenta a tu tienda a medida que evaluamos nuevas características, juzgamos la calidad de una actualización o determinamos si una mejora tiene sentido. Siempre puedes visitar los <a href=\"https://avplustuoptica.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Ajustes</a> y elegir dejar de compartir datos. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Lee más</a> sobre los datos que recopilamos.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-06-22 05:04:06', NULL, 0);
